import React from 'react';
import NavbarItem from './NavbarItem';
import TwweetBtn from './TweetBtn';
import Logo from './Logo';
import svg from '../logo.svg';

function Navbar() {
    return <div class="side-navbar">
        <Logo />
        <nav class="navbar-list">
            <NavbarItem title="Home" svg={svg} />
            <NavbarItem title="Explore" svg={svg} />
            <NavbarItem title="Notifications" />
            <NavbarItem title="Messages" />
            <NavbarItem title="Profile" />
            <NavbarItem title="More" />
            <TwweetBtn />
        </nav>
    </div>
}

export default Navbar;
